import React from "react";
import './write.css';

export default function write(){
    return(
        <div className="write">
            <form className="writeForm">
                <div className="writeFormGroup">
                    <input type="file" id="file"/>
                    <input type="text" placeholder="Title"/>
                </div>
            </form>
        </div>
    )
}
